import React from "react";

const Requirements = (props) => {
  const list = [props.data.role, props.data.level, props.data.languages];
  return (
    <div >
      {list.map((x, i) => {
          return <div key={i} className="requirements">{x}</div>;
      })}
    </div>
  );
};

export default Requirements;
